import * as FaIcons from "react-icons/fa";
import * as BaIcons from "react-icons/bs";
export const SidebarData = [
  {
    title: "Home",
    path: "/",
    icon: <FaIcons.FaHome />,
  },
  {
    title: "Adminusers",
    path: "/git",
    icon: <FaIcons.FaUserCheck />,
  },
  {
    title: "Ads",
    path: "/css",
    icon: <FaIcons.FaBriefcase />,
  },
  {
    title: "jobs",
    path: "/php",
    icon: <FaIcons.FaBriefcase />,
  },
  {
    title: "Company",
    path: "/java",
    icon: <FaIcons.FaBuilding />,
  },

  {
    title: "Userprofiles",
    path: "/node",
    icon: <BaIcons.BsFillFilePersonFill />,
  },
  {
    title: "C.M.S",
    path: "/figma",
    icon: <FaIcons.FaTasks />,
  },
  {
    title: "Languages",
    path: "/angular",
    icon: <FaIcons.FaLanguage />,
  },
  {
    title: "Countries",
    path: "/react",
    icon: <FaIcons.FaGlobeAsia />,
  },
  {
    title: "State",
    path: "/react",
    icon: <BaIcons.BsCursorFill />,
  },
  {
    title: "Packages",
    path: "/react",
    icon: <FaIcons.FaInbox />,
  },
  {
    title: "Career-level",
    path: "/react",
    icon: <FaIcons.FaGraduationCap  />,
  },
  {
    title: "Functional-areas",
    path: "/react",
    icon: <FaIcons.FaBuilding/>,
  },
  {
    title: "Gender",
    path: "/react",
    icon: <BaIcons.BsGenderAmbiguous/>,
  },
  {
    title: "Industries",
    path: "/react",
    icon: <FaIcons.FaBuilding/>,
  },
  {
    title: "Job-Experience",
    path: "/react",
    icon: <FaIcons.FaUserTie/>,
  },
  {
    title: "Job-Experience",
    path: "/react",
    icon: <FaIcons.FaUserTie/>,
  },
];
